expressions.VISIBILITY:
and(
  rv!record[recordType!AS GCM Clause Set Clause Synced.clauseSet.refStatusId] <> cons!AS_GCM_REF_ID_CLAUSE_SET_STATUS_FINALIZED,
  rv!record[recordType!AS GCM Clause Set Clause Synced.refClause.fillIn] = true(),
  if(
    /*If the toggle is set to false and when it is not available due to: the clause being from an older version,
                no fill-ins being found, or the only fill-ins are tables, or edit clause has been previously used Complete Fill-ins as a related action will not be visible */
    and(
      /*the toggle is set to false*/
      cons!AS_GCM_BOL_SHOW_FILLIN_ACCESS_INFO_TOGGLE = false(),
      or(
        rv!record[recordType!AS GCM Clause Set Clause Synced.isEditedViaEditClause] <> false(),
        rv!record[recordType!AS GCM Clause Set Clause Synced.isCompleteFillinAvailable] = false()
      )
    ),
    false(),
    true()
  )
)

